В сфере моей профессиональной деятельности в должности председателя Комиссии по городскому хозяйству и жилищной политике Московской городской Думы – непростые проблемы повседневной жизни столицы: общественный транспорт и дороги, связь и информатизация, благоустройство дворов и состояние газовых сетей.

Я участвовал в разработке: 

закона о взаимодействии с некоммерческими организациями и закона о благотворительности, которые позволяют развивать социальные инициативы населения в городе и отстаивать законные интересы наиболее незащищенных слоев москвичей; 
закона о молодежи – основополагающего для осуществления молодежной политики в столице; 
закона об эффективном управлении собственностью, принадлежащей именно нашему городу и, значит, москвичам; 
закона об информационных ресурсах и информатизации, создающего основу для развития современных информационных технологий в промышленности, образовании, медицине. 
Важнейшим считаю свое личное участие в принятии Московской городской Думой законов о социальной поддержке москвичей, которые позволили нашим ветеранам сохранить большинство льгот, отмененных Федеральным Законом № 122-ФЗ.
